const image1 = "data:image/jpeg;base64,";

var jsonObject = {
  image: image1
};
var requestOptions = {
  method: "POST",
  headers: {
    Accept: "application/json",
    "Content-Type": "application/json",
  },
  mode: "cors",
  body: JSON.stringify(jsonObject),
};
var time = [];
function callFetch(i) {
  setTimeout(() => {
    time[i] = Date.now();
    console.log(`called i = ${i}`);
    fetch("http://localhost:7861/", requestOptions)
      .then((response) => {
        // const htmlObject = await response.text();
        // console.log(i, htmlObject);
        return response.json();
      })
      .then((data) => {
        try {
          if (data.resultURLs.length === 6) {
            console.log(
              `done in i = ${i} in ${(Date.now() - time[i]) / 1000} seconds`
            );
          } else {
            console.log("miss");
          }
        } catch {
          console.log(data);
        }
      })
      .catch((error) => console.log(`error ${i}`, error));
  }, 100 * (i + 1));
}

for (let i = 0; i < 1; i++) {
  callFetch(i);
}
